import axios from "axios";
import React, { useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import './enter.css';

function Lawyerenter() {
  const navigate = useNavigate();
  let { userId } = useParams();

  const [lawyer, setLawyer] = useState({});
  const [appoinment, setAppoinment] = useState([]);
  const [activeComponent, setActiveComponent] = useState("ComponentA");

  const showComponent = (component) => {
    setActiveComponent(component);
  };

  const lawyerid = async () => {
    try {
      const lawyerRes = await axios.get(`http://localhost:7000/lawyeruid?userId=${userId}`);
      setLawyer(lawyerRes.data);

      const appoinmentRes = await axios.get(`http://localhost:7000/appoinmentval?lawyerId=${lawyerRes.data._id}`);
      setAppoinment(appoinmentRes.data);
    } catch (err) {
      console.error("Error fetching data:", err);
    }
  };

  useEffect(() => {
    lawyerid();
  }, []);

  return (
    <div className="enter-out">
      <div className="welcsd">
        <div className="card_container12">
          <div className="card12">
            <div className="title12">
              <span>Hi, {lawyer.name}</span>
            </div>
          </div>
          <div className="tools1">
            <button onClick={() => showComponent("ComponentA")}>Appoinments</button>
            <button onClick={() => showComponent("ComponentB")}>Account</button>
            <button onClick={() => showComponent("ComponentC")}>Following</button>
            <button onClick={() => showComponent("ComponentD")}>Notifications</button>
          </div>
          <div className="component-container">
            {activeComponent === "ComponentA" && <ComponentA appoinment={appoinment} />}
            {activeComponent === "ComponentB" && <ComponentB />}
            {activeComponent === "ComponentC" && <ComponentC />}
            {activeComponent === "ComponentD" && <ComponentD />}
          </div>
        </div>
      </div>
    </div>
  );
}

function ComponentA({ appoinment }) {
  return (
    <div className="scroll-snap-cardll">
      {appoinment.map((value) => (
        <div key={value._id} className="space-ll">
          <div className="card70">
            <div className="img70">
              <img src={`http://localhost:7000/static/${value.originalname}`} style={{ width: "50px", height: "50px" }} alt="Appointee" />
            </div>
            <div className="textBox70">
              <div className="textContent70">
                <p className="h170">{value.name}</p>
                <span className="span70">{value.ondate}</span>
              </div>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
}

function ComponentB() {
  return <div>ComponentB Content</div>;
}

function ComponentC() {
  return <div>ComponentC Content</div>;
}

function ComponentD() {
  return <div>ComponentD Content</div>;
}

export default Lawyerenter;
